let cacheName="discipline-pwa",filesToCache=["/","/index.html","https://fonts.googleapis.com/css?family=Nunito","https://use.fontawesome.com/372afdc18b.js"];self.addEventListener("install",e=>{e.waitUntil(caches.open(cacheName).then(function(e){return e.addAll(filesToCache.map(function(e){return new Request(e,{mode:"no-cors"})}))}))}),self.addEventListener("fetch",e=>{e.respondWith(caches.match(e.request).then(t=>t||fetch(e.request)))});